  function searchCSV() {
    const searchInput = document.getElementById('searchInput');
    const searchValueLower = searchInput.value.toLowerCase();
    const results = csvData.filter(obj => 
      (obj.codigo && obj.codigo.toLowerCase().includes(searchValueLower)) ||
      (obj.especialidade && obj.especialidade.toLowerCase().includes(searchValueLower)) ||
      (obj.doenca && obj.doenca.toLowerCase().includes(searchValueLower)) ||
      (obj.descricao && obj.descricao.toLowerCase().includes(searchValueLower))
    );
    displayResults(results);
  }
  
  function displayResults(results) {
    const resultsDiv = document.getElementById('results');
    let tableHTML = '<table>';
    tableHTML += `
      <tr>
        <th>Código</th>
        <th>Especialidade</th>
        <th>Doença</th>
        <th>Descrição</th>
      </tr>
    `;
  
    results.forEach(result => {
      tableHTML += `
        <tr>
          <td>${result.codigo}</td>
          <td>${result.especialidade}</td>
          <td>${result.doenca}</td>
          <td>${result.descricao}</td>
        </tr>
      `;
    });
  
    tableHTML += '</table>';
    resultsDiv.innerHTML = tableHTML;
  }
  
  // Disparar a pesquisa quando a página carrega
  window.onload = searchCSV;
  
